import '../styles/global.css'
import DataContext from '../components/DataContext';

const Joornalo = ({ Component, pageProps }) => {

  state = {
    templates: []
  };

  return (
    <DataContext.Provider value={{ user: this.state.templates }}>
      <Component {...pageProps} />
    </DataContext.Provider>
  );
}

export default Joornalo
